import "./style.scss";
import RangerSlider from "../../components/Slider";
import { Container, Row, Col } from "react-bootstrap";
function Main() {
  return (
      <Container className="fondo">
          <Row>
            <Col className="a1">

            </Col>
            <Col className="a2">1</Col>
            <Col className="a3">1</Col>
            <Col className="a4">1</Col>
          </Row>
          <Row>
            <Col>1</Col>
            <Col>1</Col>
            <Col>1</Col>
            <Col>1</Col>
          </Row>
      </Container>
  );
}

export default Main;
